onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{
		// 能量喷泉2段派生
		if(Key.isDown(自机.B键))
		{_parent.gotoAndPlay("能量喷泉2段");}

		// 统一走搓招函数（支持DFA预输入）
		_root.技能函数.能量喷泉可派生搓招();
	}
}

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{
		// 能量喷泉3段派生
		if(Key.isDown(自机.B键))
		{_parent.gotoAndPlay("能量喷泉3段");}

		// 统一走搓招函数（支持DFA预输入）
		_root.技能函数.能量喷泉可派生搓招();
	}
}

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{_parent.能量喷泉可派生搓招();}
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}

